import React from 'react';
import { useSelector } from 'react-redux';
import { Card } from 'antd';
const UserProfile = () => {
    const {user} = useSelector(state => state.user);
    return (
        <>
        <h1>{user[0]}</h1>
        <Card>
            
        </Card>
        </>
    );
};

export default UserProfile;
